COPY public.categorias (id_categoria, nombre, descripcion) FROM stdin;
1	Productos Frescos	Frutas, verduras y alimentos que requieren refrigeración
2	Abarrotes	Productos de despensa como arroz, frijoles, pastas, etc.
3	Bebidas	Refrescos, jugos, aguas y bebidas energéticas
4	Cuidado Personal	Artículos de higiene y cuidado corporal como shampoo, jabón y cremas
5	Cuidado del Hogar	Productos de limpieza y mantenimiento del hogar
6	Cuidado de mascotas	Alimentos y productos para el cuidado de animales domésticos
7	Niños	Productos para bebés y niños, como pañales, toallitas y alimentos infantiles
8	Cervezas, vinos y licores	Bebidas alcohólicas de todo tipo
9	Tecnología	Artículos electrónicos como audífonos, cargadores, accesorios móviles
10	Productos congelados	Comidas y alimentos que se almacenan congelados
11	Oficina y escolares	Útiles escolares y artículos para oficina como papel, lápices y carpetas
\.
